import React from "react";

export const Tile = ({cname, description}) => {
  const descriptions = Object.values(description).map((value,index)=>(
    <p key={index} className="tile">{value}</p>
  ));
  return (
    <div className="tile-container">
      <p className="tile-title tile">{name}</p>
      {descriptions}
    </div>
  );
};
